import React, { useState } from 'react';
import '../styles/SignupForm.css';

const SignupPage = () => {
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [commune, setCommune] = useState('');
  const [status, setStatus] = useState('');
  const [termsAccepted, setTermsAccepted] = useState(false);

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!termsAccepted) {
      alert("Veuillez accepter les termes de confidentialitÃ©.");
      return;
    }
    if (password !== confirmPassword) {
      alert("Les mots de passe ne correspondent pas.");
      return;
    }
    
    // Logique d'inscription
    console.log('Inscription:', { firstName, lastName, email, password, commune, status });
    // API call pour enregistrer l'utilisateur
  };

  return (
    <div className="signup-container">
      <form onSubmit={handleSubmit}>
      <h2 style={{ fontSize: '3em', position: 'absolute', top: '20px', left: '20px' }}>S'inscrire</h2>
      <h2 style={{ fontSize: '3em', position: 'absolute', top: '80px', left: '20px' }}>C'est simple et rapide</h2>

        {/* Nom et PrÃ©nom sur la mÃªme ligne */}
        <div className="name-row">
          <div className="form-group">
            <label>Nom :</label>
            <input 
              type="text" 
              value={lastName} 
              onChange={(e) => setLastName(e.target.value)} 
              placeholder="Entrez votre nom" 
              required 
            />
          </div>
          <div className="form-group">
            <label>PrÃ©nom :</label>
            <input 
              type="text" 
              value={firstName} 
              onChange={(e) => setFirstName(e.target.value)} 
              placeholder="Entrez votre prÃ©nom" 
              required 
            />
          </div>
        </div>

        <div className="form-group">
          <label>Commune :</label>
          <input 
            type="text" 
            value={commune} 
            onChange={(e) => setCommune(e.target.value)} 
            placeholder="Entrez votre commune" 
            required 
          />
        </div>
        <div className="form-group">
          <label>Email :</label>
          <input 
            type="email" 
            value={email} 
            onChange={(e) => setEmail(e.target.value)} 
            placeholder="Entrez votre email" 
            required 
          />
        </div>
        <div className="form-group">
          <label>Mot de passe :</label>
          <input 
            type="password" 
            value={password} 
            onChange={(e) => setPassword(e.target.value)} 
            placeholder="Entrez votre mot de passe" 
            required 
          />
        </div>
        <div className="form-group">
          <label>Confirmer le mot de passe :</label>
          <input 
            type="password" 
            value={confirmPassword} 
            onChange={(e) => setConfirmPassword(e.target.value)} 
            placeholder="Confirmez votre mot de passe" 
            required 
          />
        </div>
        
        <div className="form-group">
          <label>Statut :</label>
          <select value={status} onChange={(e) => setStatus(e.target.value)} required>
            <option value="" disabled>SÃ©lectionnez votre statut</option>
            <option value="utilisateur">Utilisateur</option>
            <option value="actionnaire">Actionnaire</option>
          </select>
        </div>

        <div className="form-group">
          <input 
            type="checkbox" 
            checked={termsAccepted} 
            onChange={(e) => setTermsAccepted(e.target.checked)} 
            required 
          />
          <label> J'accepte les <a href="/confidentialite">termes de confidentialitÃ©</a>.</label>
        </div>

        <button type="submit">S'inscrire</button>
      </form>
    </div>
  );
};

export default SignupPage;
